import React from 'react';
import Navbar from './components/Navbar';
import Home from './components/pages/Home';
import {BrowserRouter,Route,Routes} from 'react-router-dom';
import "./App.css"
function App() {
    return (
        <BrowserRouter>
        <Navbar />
        <Routes>
            <Route path="/">
                <Home />
            </Route>
        </Routes>
        </BrowserRouter>
    );
  }
  
  export default App;
